import React from 'react';

const Browse = () => {
  const productStyle = {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    marginTop: '20px',
  };

  const imageStyle = {
    width: '200px', // Adjust the width as needed
    height: '200px', // Adjust the height as needed
    objectFit: 'cover', // Maintain aspect ratio
    borderRadius: '10px', // Optional: Add border-radius for rounded corners
  };

  const priceStyle = {
    marginTop: '10px',
    fontSize: '18px',
    fontWeight: 'bold',
    color: 'green', // Optional: Set the color for the price
  };

  return (
    <div>
      <div style={productStyle}>
        <img
          src="tree_image_url_1.jpg" // Replace with the actual URL of the first tree image
          alt="Tree 1"
          style={imageStyle}
        />
        <p style={priceStyle}>$50.00</p>
      </div>

      <div style={productStyle}>
        <img
          src="tree_image_url_2.jpg" // Replace with the actual URL of the second tree image
          alt="Tree 2"
          style={imageStyle}
        />
        <p style={priceStyle}>$65.00</p>
      </div>

      {/* Add more product entries as needed */}
    </div>
  );
};

export default Browse;
